Solução de tecnologia consiste na contratação emergencial de pessoa jurídica especializada na prestação de serviço comuns e continuados, sem dedicação de mão-de-obra, como: 2.1.1. Serviço de Impressão.
- Disponibilização de equipamentos novos ou usados de impressão de uso corporativo para impressão, cópia e digitalização de documentos - segundo especificações;
- Disponibilização de equipamentos de uso corporativo multitarefa para impressão técnica em grandes formatos – segundo especificações, quantidades e distribuição definidas no Termo de Referência 77/2025;
- Impressão / reprodução de documentos corporativos em formatos convencionais (A3/A4);
- Instalação e configuração dos equipamentos e da solução de gerenciamento dos serviços, incluindo todos os seus componentes e orientação técnica à equipe designada pelo tomador do serviço;
- Provimento de assistência técnica on-site, com manutenção preventiva/corretiva e reposição de peças – incluindo provimento de solução de gestão de atendimento ao usuário;
- Fornecimento contínuo de suprimentos e consumíveis de impressão (exceto papéis ou outras mídias de impressão) – incluindo, por exemplo, cartuchos de toner e outros suprimentos e consumíveis de substituição contínua (todos novos, não remanufaturados, originais e genuínos do fabricante dos equipamentos a serem aplicados);
- Orientação e suporte aos usuários da solução e repasse de conhecimentos acumulados ao longo da prestação dos serviços.
